import React from 'react';
import { Link } from 'react-router-dom';


const Header = () => {
  return(
    <header>
      <nav>
        <h1 className="brand">Lex Food</h1>
        <ul>
          <li><Link to="/">Home</Link></li>
        </ul>
      </nav>
    </header>
  )
}

export default Header;
